import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import React from 'react';
import AbsherHome from '../components/AbsherHome';
import './Home.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonContent>
        <AbsherHome />
      </IonContent>
    </IonPage>
  );
};

export default Home;
